//sun9-71.userapi.com/c638116/v638116237/62561/k9T3wJDtqwU.jpg","type":"w","width":2560},{"height":453,"url":"https://sun9-59.userapi.com/c638116/v638116237/6255e/3E3FIP1iL0A.jpg","type":"x","width":604},{"height":605,"url":"https://sun9-36.userapi.com/c638116/v638116237/6255f/DQCdfGClkVM.jpg","type":"y","width":807},{"height":960,"url":"https://sun9-63.userapi.com/c638116/v638116237/62560/4OR4OaanxOk.jpg","type":"z","width":1280}],"text":"","user_id":100}}],"can_edit":0},{"id":1921,"from_id":54743233,"date":1505423715,"text":"\u0421\u0435\u0433\u043e\u0434\u043d\u044f \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0438 \u043d\u0430\u0448\u0443 \u0434\u043e\u043b\u0433\u043e\u0436\u0434\u0430\u043d\u043d\u0443\u044e \u043a\u0443\u0445\u043d\u044e! \u041c\u044b \u0443\u0436\u0435 \u0432\u0442\u043e\u0440\u043e\u0439 \u0440\u0430\u0437 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0430\u0435\u043c \u0441 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0435\u0439. \u0412 \u0444\u0435\u0432\u0440\u0430\u043b\u0435 \u0437\u0430\u043a\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u043c\u0435\u0431\u0435\u043b\u044c \u0432 \u0441\u043f\u0430\u043b\u044c\u043d\u044e, \u0441\u0434\u0435\u043b\u0430\u043b\u0438 \u0432\u0441\u0451 \u0431\u044b\u0441\u0442\u0440\u043e \u0438 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u043d\u0430\u043c \u043f\u043e\u043d\u0440\u0430\u0432\u0438\u043b\u043e\u0441\u044c:) \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0432\u043e\u043f\u0440\u043e\u0441, \u0433\u0434\u0435 \u0437\u0430\u043a\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u043a\u0443\u0445\u043d\u044e \u043d\u0435 \u0441\u0442\u043e\u044f\u043b! \u041d\u0430\u043c \u0441\u0434\u0435\u043b\u0430\u043b\u0438 \u0440\u0430\u0441\u0441\u0440\u043e\u0447\u043a\u0443 \u0438 \u043f\u0440\u0438\u044f\u0442\u043d\u0443\u044e \u0441\u043a\u0438\u0434\u043a\u0443:) \u0411\u043e\u043b\u044c\u0448\u043e\u0435 \u0441\u043f\u0430\u0441\u0438\u0431\u043e \u0434\u0438\u0437\u0430\u0439\u043d\u0435\u0440\u0443 \u0410\u043d\u043d\u0435, \u043e\u043d\u0430 \u0443\u0447\u043b\u0430 \u0432\u0441\u0435 \u043d\u0430\u0448\u0438 \u043f\u043e\u0436\u0435\u043b\u0430\u043d\u0438\u044f! \u0418\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u0431\u044b\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u043e\u0436\u0435\u043b\u0430\u043d\u0438\u044f \u0438 \u0410\u043d\u044f \u043f\u0440\u043e\u0441\u0442\u043e \u044f\u0441\u043d\u043e\u0432\u0438\u0434\u044f\u0449\u0430\u044f - \u0434\u043e\u0433\u0430\u0434\u0430\u043b\u0430\u0441\u044c, \u0447\u0442\u043e \u044f \u0445\u043e\u0447\u0443 \u0438 \u0441\u043e\u0437\u0434\u0430\u043b\u0430 \u043a\u0443\u0445\u043d\u044e \u043c\u043e\u0435\u0439 \u043c\u0435\u0447\u0442\u044b! \u041e\u0433\u0440\u043e\u043c\u043d\u043e\u0435 \u0441\u043f\u0430\u0441\u0438\u0431\u043e \u043c\u0430\u0441\u0442\u0435\u0440\u0430\u043c \u0434\u0432\u0443\u043c \u0421\u0435\u0440\u0433\u0435\u044f\u043c, \u043e\u043d\u0438 \u0442\u0440\u0443\u0434\u0438\u043b\u0438\u0441\u044c \u0434\u0432\u0430 \u0434\u043d\u044f! \u0420\u0430\u0431\u043e\u0442\u0430\u043b\u0438 \u0447\u0451\u0442\u043a\u043e \u0438 \u0433\u0440\u0430\u043c\u043e\u0442\u043d\u043e, \u0447\u0438\u0441\u0442\u043e \u0438 \u0430\u043a\u043a\u0443\u0440\u0430\u0442\u043d\u043e. \u041d\u043e \u0432 \u0442\u043e \u0436\u0435 \u0432\u0440\u0435\u043c\u044f \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u0432 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043c\u043e\u043c\u0435\u043d\u0442\u0430\u0445, \u043a\u0430\u043a \u043d\u0430\u043c \u0443\u0434\u043e\u0431\u043d\u0435\u0435:) \u0421\u043f\u0430\u0441\u0438\u0431\u043e, \u043f\u0440\u0438\u044f\u0442\u043d\u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0430\u0442\u044c \u0441 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u0430\u043c\u0438:))) \u041e\u0439, \u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0438 \u0442\u043e \u0443\u0436\u0435 \u0432\u0447\u0435\u0440\u0430:) \u0418 \u043e\u0441\u0442\u0430\u043b\u0438\u0441\u044c \u0437\u0430\u0434\u0443\u043c\u043a\u0438, \u043c\u0435\u0441\u0442\u0430 \u0432 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0435 \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e:)","attachments":[{"type":"photo","photo":{"album_id":-12,"date":1505423715,"id":456242632,"owner_id":-71768893,"has_tags":false,"access_key":"7b80aebb71cc08308d","lat":64.586365,"long":40.51352,"sizes":[{"height":130,"url":"https://sun9-48.userapi.com/c837227/v837227058/4f201/IFzKypy8Csw.jpg","type":"m","width":97},{"height":173,"url":"https://sun9-28.userapi.com/c837227/v837227058/4f205/cMM8iMUdmO4.jpg","type":"o","width":130},{"height":267,"url":"https://sun9-48.userapi.com/c837227/v837227058/4f206/IZjMgNRzZwI.jpg","type":"p","width":200},{"height":427,"url":"https://sun9-55.userapi.com/c837227/v837227058/4f207/blCnQPQZXIo.jpg","type":"q","width":320},{"height":680,"url":"https://sun9-43.userapi.com/c837227/v837227058/4f208/kWBb1R76q7I.jpg","type":"r","width":510},{"height":75,"url":"https://sun9-29.userapi.com/c837227/v837227058/4f200/8eUe3Zcwj2c.jpg","type":"s","width":56},{"height":604,"url":"https://sun9-4.userapi.com/c837227/v837227058/4f202/Ws6bzMv6z3M.jpg","type":"x","width":453},{"height":807,"url":"https://sun9-15.userapi.com/c837227/v837227058/4f203/B6N0A9OpoIw.jpg","type":"y","width":605},{"height":960,"url":"https://sun9-26.userapi.com/c837227/v837227058/4f204/Y6I39z_z9vs.jpg","type":"z","width":720}],"text":"","user_id":100}},{"type":"photo","photo":{"album_id":-12,"date":1505423715,"id":456242633,"owner_id":-71768893,"has_tags":false,"access_key":"67b1c306cb1aff2cf7","lat":64.586365,"long":40.51352,"sizes":[{"height":130,"url":"https://sun9-44.userapi.com/c836629/v836629058/7bf7f/ijXOn30PFfU.jpg","type":"m","width":97},{"height":173,"url":"https://sun9-36.userapi.com/c836629/v836629058/7bf83/0u1jwn2Piew.jpg","type"